p[1]="Rings Warm-Up for Shoulder Press \n* Tuck to inverted hang, then skin the cat \n* Pike to inverted hang, then skin the cat \n* Strict muscle-up to support to L-sit \n* Shoulder stand back to L-support or straddle support \n* Forward roll back to L-support \n* Forward roll to hang \n* Pike or tuck to inverted hang to back-lever attempt, pull back to inverted hang \n* Front-lever attempt \n* Ring swings \n* Ring dips (focus on full range of motion and controlled movement) \n* Ring push-ups (emphasize control and proper form) \n* Fly-away dismount (skin the cat and let go)"
p[2]="Basic Body Weight (BBW) Warm-Up for Shoulder Press \n* Round 1: Squat, Push-up, Sit-up, Pull-up (strict), Hip extension, Pike push-up (to target shoulders more effectively) \n* Round 2: Lunge, Dip (strict), V-up, Kipping pull-up, Back extension, Handstand hold against a wall (to build shoulder strength and stability) \n* Round 3: Pistol, Handstand push-up, Toes-to-bar (straight leg and strict), Muscle-up (strict), Hip and back extension, Inverted shoulder taps (with feet elevated on a box or bench) \n* Round 4: Pose running drill, Shoulder tap push-ups (alternate tapping shoulders after each push-up)"
